import React, { Component } from "react";

export class Admin extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: localStorage.getItem("user")
    };
  }
  render() {
    const { user } = this.state;
    return (
      <div>
        <h1>Admin Page{this.state.user}</h1>
      </div>
    );
  }
}

export default Admin;
